import Banner from '../public/banner'

export default class extends React.Component{
    render(){
        return(
            <div className='arriba'>
                <Banner/>
                <style jsx>
                    {`
                        .arriba{
                            margin-top: 20px;
                        }
                    `}
                </style>
            </div>
        );
    }
}
